import {
    Paper,
    Stack
} from "@mui/material"
import React from "react"

import { colors } from "../../utils/CustomTheme"
const pages = [
    { text: "Genscom", link: "/" },
]

const Header = () => {
    return (
        <Stack sx={{ height: 70, marginBottom: 30, borderWidth: 1, borderColor: colors.saffronOrange }}>
            <Paper>
                HEADER
            </Paper>
        </Stack>
    )
}
export default Header
